import "./App.css";
import BackgroundAnimate from "./backgroundanimation";
import LinkResult from "./linkresult";
import Shortener from "./shortener";

function App() {
  return (
    <div className="container">
      <Shortener />
      <BackgroundAnimate />
      <LinkResult />
    </div>
  );
}

export default App;
